[Change_log]
log="\n- A lot improvements has been made in the latest version, please check online Change log page to learn more.\n\n- 您正在使用老旧版本, 建议立即更新. 最新版中已进行了很多改进, 包含新的超分辨率和补帧(插帧)技术. 请查阅在线更新日志页面以了解更多.\n\n- 您正在使用老舊版本, 建議立即更新. 最新版中已進行了很多改進, 包含新的超分辨率和補幀(插幀)技術. 請查閱在線更新日誌頁面以了解更多."
log_SimplifiedChinese="\n- 2026新年快乐！\n- 新模型：Omni-Turbo-W2xEX V1.5 更新，通过持续训练改进了降噪和清晰度。\n- 更智能地处理极高分辨率图像，更好地适应不同的超分辨率引擎和设置。\n- 加快了对 RTX 50 系列的兼容性测试。\n- 更新了部分控制台消息。\n\n更新日期: 2026年1月2日"
log_TraditionalChinese="\n- 2026新年快樂！\n- 新模型：Omni-Turbo-W2xEX V1.5 更新，透過持續訓練改善了降噪與清晰度。\n- 更智慧地處理極高解析度影像，更好地適應不同的超解析度引擎與設定。\n- 加速了對 RTX 50 系列的相容性測試。\n- 更新了部分主控台訊息。\n\n更新日期: 2026年1月2日"
log_English="\n- HAPPY NEW YEAR 2026!\n- NEW Model: V1.5 update for Omni-Turbo-W2xEX, improved denoise and clarity through continue training.\n- Smarter handling of extreme high-res images, better adapted for different super-res engines and settings.\n- Faster compatibility test on RTX 50 series.\n- Update some console messages.\n\nRelease Date: January 2, 2026"
